  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is an LAZ (compressed LAS)
  format file containing LIDAR point cloud data. This data set is an LAZ (compressed
  LAS) format file containing LIDAR point cloud data. In March 2012, WSI (Watershed
  Sciences, Inc.) was contracted by Woolpert, Inc. (Woolpert) to collect Light Detection
  and Ranging (LiDAR) data and digital imagery in the fall of 2012 for the Bridge
  Creek LiDAR site in Oregon. The LiDAR survey used a Leica ALS60 laser system, classified
  to ground and non-ground points, stored in LAS 1.2 format. WSI (Watershed Sciences,
  Inc.) was contracted by Woolpert, Inc. (Woolpert) to collect Light Detection and
  Ranging (LiDAR) data for the Bridge Creek LiDAR site in Oregon. The project area
  delivered is 9163 square acres. These files contain classified topographic lidar
  data as unclassified valid topographic data (1), and valid topographic data classified
  as ground (2). Classes 1 and 2 are defined in accordance with the American Society
  for Photogrammetry and Remote Sensing (ASPRS) classification standards.\",\n\t\"owner_org\":
